وهى ظاهرة الانهاك الجسمانى والعقلى والذهنى والوجدانى بسبب الإرهاق فى العمل بمنظومة صحية فاسدة، ويجب طلب الرحمة للفقيدة، والدعاء على نظام فاشل فاسد مستبد،
ألا لعنة الله على الظالمين

